import React, {Component} from 'react';
import Article from './Article';
import NavBar from './NavBar';
import 'bootstrap/dist/css/bootstrap.css'

class App extends Component{
    render () {
        const {list} = this.props;

        return (
            <div className="container" style={{background: 'url(https://ru.best-wallpaper.net/wallpaper/1920x1200/1801/Lot-of-dogs-sit-in-a-line_1920x1200.jpg)'}}>
                <NavBar />
                <Article list={list}/>

            </div>
        );
    }  
}


export default App;
